import axios from 'axios'
import { FormatPersona } from './FormatData';

const personasURL = "http://localhost:3050/personas/";

const PostPersona = (data) =>{

    const formatedData = FormatPersona(data)

    axios({
        method: 'post',
        url: personasURL,
        data: formatedData
      }).then((response)=>{
          console.log(response)
      }).catch(err =>{
          alert(err)
      });
}

export {PostPersona}
